!function(t){try{t=angular.module("csg")}catch(n){t=angular.module("csg",[])}t.run(["$templateCache",function(t){"use strict";t.put("ui/instruction-diagram/instruction-diagram.html",'<div class="instruction-diagram">\n    <div class="diagram-row" ng-repeat="instruction in vm.getLatestCalculation().instructions"\n         style="height: {{ vm.getRowHeight($index) }}; width: {{ vm.getRowWidth($index) }}">\n    </div>\n</div>'),t.put("ui/calculation-form/calculation-form.html",'<form id="calculation-form" class="grid-3-middle-noGutter">\n    <div class="col">\n        <label id="number-of-rows-label" for="number-of-rows">Number of rows</label>\n    </div>\n    <div class="col">\n        <input id="number-of-rows" type="text" ng-model="vm.numberOfRows">\n    </div>\n    <div class="col">\n        <button id="calculate" ng-click="vm.calculate()" type="button">Calculate</button>\n    </div>\n</form>'),t.put("ui/instruction-pane/instruction-pane.html",'<div class="grid-1-noGutter" ng-show="vm.getLatestCalculation()">\n    <div class="col instruction-row" ng-repeat="instruction in vm.latestCalculation.instructions">\n        <p class="instruction-entry">{{ instruction.getInstructionText() }}</p>\n    </div>\n</div>')}])}();